import React from "react";

function Cos() {
    return(
        <div id="home-header">
            <div>
            <section id="banner-pag-accesorii" className="text-banner-produse">
                <h1>Accesorii pentru jucarii</h1>
                <h4>Rdeucere de <span>30%</span> pentru comenzile peste <span>500 Lei</span></h4>
            </section>
            </div>
        </div>                 
    )
}
export default Cos;
